function makeChunks(){

	var activeChunks = _.where(chunks, {active: 1})
	for (var i = 0; i < activeChunks.length; i++) {
		var chunk = activeChunks[i];
		
		var operators = [[-1,-1],[-1,0],[-1,1],[0,-1],[0,0],[0,1],[1,-1],[1,0],[1,1]];

		for (var i = 0; i < operators.length; i++) {
			var x_delta = operators[i][0];
			var y_delta = operators[i][1];

			var borderingChunk = _.findWhere(chunks, {x: chunk.x + x_delta, y: chunk.y + y_delta})
			if (borderingChunk === undefined) {
				var tempNewChunk = new newChunk(chunk.x + x_delta, chunk.y + y_delta, 0);
				chunks.push(tempNewChunk);
			};
		};
	};

}

function activateChunks(){

	for (var i = 0; i < chunks.length; i++) {
		if(chunks[i].active == 1){
			var activeChunk = chunks[i];
			for (var y = 0; y < chunks[i].cells.length; y++) {
				if (
					(chunks[i].cells[y][0].alive == 1 || chunks[i].cells[y][gameSettings.chunkSize-1].alive == 1) ||
					(chunks[i].cells[0][y].alive == 1 || chunks[i].cells[gameSettings.chunkSize-1][y].alive == 1)
				) {
					//console.log('live cell found');
					$.each(chunks, function(){
						if (
							(this.x == activeChunk.x+1 && this.y == activeChunk.y) ||
							(this.x == activeChunk.x-1 && this.y == activeChunk.y) ||
							(this.y == activeChunk.y+1 && this.x == activeChunk.x) ||
							(this.y == activeChunk.y-1 && this.x == activeChunk.x)
						) {
							console.log('activate');
							this.active = 1;
						};
					});
				};
			};
		}
	};

}

// Kill cells marked keep == 0
function kill(){
	for (var i = chunks.length - 1; i >= 0; i--) {
		for (var y = chunks[i].cells.length - 1; y >= 0; y--) {
			for (var z = chunks[i].cells[y].length - 1; z >= 0; z--) {
				cell = chunks[i].cells[y][z];
				if (cell.keep == 0){
					cell.alive = 0;
				}
				else if(cell.keep == 1){
					cell.alive = 1;
				}
			};
		};
	};

	killReset();
}

function killReset(){
	for (var i = chunks.length - 1; i >= 0; i--) {
		for (var y = chunks[i].cells.length - 1; y >= 0; y--) {
			for (var z = chunks[i].cells[y].length - 1; z >= 0; z--) {
				cell = chunks[i].cells[y][z];
				if (cell.keep == 1){
					cell.keep = 0;
				};
			};
		};
	};
}

// Pretty gfx
function drawChunks(){
	clearCanvas();

	// Test
	ctx.fillStyle = '#000';
	ctx.fillRect(0, 0, gameSettings.zoom, gameSettings.zoom);
	ctx.fillRect(396, 0, gameSettings.zoom, gameSettings.zoom);
	ctx.fillRect(0, 396, gameSettings.zoom, gameSettings.zoom);
	ctx.fillRect(396, 396, gameSettings.zoom, gameSettings.zoom);

	for (var i = chunks.length - 1; i >= 0; i--) {
		drawChunk(chunks[i]);
	};
}

function drawChunk(chunk){

	var zoom = gameSettings.zoom;

	ctx.fillStyle = '#4BC379';

	// Draw chunk background
	ctx.fillRect(chunk.x * zoom * gameSettings.chunkSize, chunk.y * zoom * gameSettings.chunkSize, zoom * gameSettings.chunkSize, zoom * gameSettings.chunkSize);

	// Draw cells
	for (var y = chunk.cells.length - 1; y >= 0; y--) {
		chunk.cells[y]

		for (var x = chunk.cells[y].length - 1; x >= 0; x--) {
			var cell = chunk.cells[y][x];

			if (cell.alive == 1){
				var xCoords = (chunk.x * gameSettings.chunkSize + x) * zoom;
				var yCoords = (chunk.y * gameSettings.chunkSize + y) * zoom;

				ctx.fillStyle = '#000';
				ctx.fillRect(xCoords, yCoords, zoom, zoom);
			};
		};
	};
}

// Clear canvas
function clearCanvas(){
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	ctx.beginPath();
}
